><div></div><p><strong><span style=\"font-family: 宋体;color:#717171\">关于</span><span style=\"color: rgb(113, 113, 113); font-family: Arial;\">即客</span></strong><br/></p><p style=\"margin-top:5px;margin-right:0;margin-bottom:18px;margin-left:0;text-align:left;background:white\"><span style=\"font-size:12px;font-family:宋体;color:#717171\"></span></p><p><span style=\"color: rgb(113, 113, 113); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">上海等势线计算机科技有限公司 简称为ETW，或ETW国际</span></p><p><br/></p><p><span style=\"font-size: 12px;\">中悦拥有强大的技术研发、销售、运营实力，成功接入和整合支付宝、微信、平安银行等支付入口，以“开赚钱的店，让生意变得更简单”为使命，致力于将“即客”平台打造为零售业最具商业价值的营销管理SAAS软件。</span></p><p><span style=\"font-size: 12px;\">2016年，公司成功推出即客v1.0新产品。截止2017年12月，公司已经拥有近百家代理商，超<strong>50000</strong>家商户，覆盖行业<strong>30</strong>余个，年交易流水过<strong>百亿</strong>元。2017年，公司根据市场需求推出即客v2.0。</span></p><p><span style=\"font-size: 12px;\">中悦在保持较高业务增长速度的同时，与政府展开深度合作，为公司带来众多媒体焦点和丰富政府资源。</span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\"><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">即客所做的一切都能被证明，不能被证明的事物可以定义为假！！！&nbsp;</span><span style=\"box-sizing: border-box; padding: 0px; margin: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\"><a class=\"bluecol redcol\" href=\"https://www.etwservice.com/etwspeak/report.html\" target=\"_blank\" style=\"box-sizing: border-box; padding: 2px 5px; margin: 0px; background: rgb(154, 35, 52); color: rgb(255, 255, 255); text-decoration-line: none; outline: 0px; border-radius: 3px; text-shadow: rgb(51, 51, 51) 0px 1px;\">了解更多ETW</a></span></span></p><p><br/><span style=\"color: rgb(113, 113, 113); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\"></span></p><p style=\"text-align:left;background:white\"><a target=\"_blank\" href=\"https://www.etwservice.com/setlayer_self.htm\" style=\"box-sizing: border-box; padding: 2px 10px; margin: 0px 10px 10px 0px; background: 0px 0px rgb(255, 255, 255); color: rgb(10, 98, 169); text-decoration-line: none; outline: 0px; display: inline-block; border: 1px solid rgb(204, 204, 204); border-radius: 0px; font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; white-space: normal;\">感谢信！</a><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"text-align: left; background: white;\"><span style=\"font-size:12px;font-family:Arial;color:#333333\">&nbsp;</span></p><p style=\"text-indent: 2em;\"><strong>即客工作现场</strong></p><p><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520487992273037914.jpg\" title=\"1520487992273037914.jpg\" alt=\"line.jpg\"/></p><p style=\"text-align: center;\"><br/></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; text-align: center;\"><img alt=\"\" src=\"/ETW/ueditor/jsp/upload/image/20180308/1520487940327045439.jpg\" class=\"etwimg\"/></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; text-align: center;\"><img alt=\"\" src=\"/ETW/ueditor/jsp/upload/image/20180308/1520487940372059704.jpg\" class=\"etwimg\"/></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; text-align: center;\"><img alt=\"\" src=\"/ETW/ueditor/jsp/upload/image/20180308/1520487940403089237.jpg\" class=\"etwimg\"/></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; text-align: center;\"><img alt=\"\" src=\"/ETW/ueditor/jsp/upload/image/20180308/1520487940450025371.jpg\" class=\"etwimg