adding-left:35px}\nli.list-num2-paddingleft-2{padding-left:40px}\nli.list-dash{background-image:url(http://bs.baidu.com/listicon/dash.gif)}\nul.custom_dash{list-style:none;}ul.custom_dash li{background-position:0 3px;background-repeat:no-repeat}\nli.list-dash-paddingleft{padding-left:35px}\nli.list-dot{background-image:url(http://bs.baidu.com/listicon/dot.gif)}\nul.custom_dot{list-style:none;}ul.custom_dot li{background-position:0 3px;background-repeat:no-repeat}\nli.list-dot-paddingleft{padding-left:20px}\n.list-paddingleft-1{padding-left:0}\n.list-paddingleft-2{padding-left:30px}\n.list-paddingleft-3{padding-left:60px}</style><style id=\"pagebreak\">.pagebreak{display:block;clear:both !important;cursor:default !important;width: 100% !important;margin:0;}</style><style id=\"pre\">pre{margin:.5em 0;padding:.4em .6em;border-radius:8px;background:#f8f8f8;}</style><style id=\"loading\">.loadingclass{display:inline-block;cursor:default;background: url(\'http://localhost:8082/ETW/ueditor/themes/default/images/loading.gif\') no-repeat center center transparent;border:1px solid #cccccc;margin-left:1px;height: 22px;width: 22px;}\n.loaderrorclass{display:inline-block;cursor:default;background: url(\'http://localhost:8082/ETW/ueditor/themes/default/images/loaderror.png\') no-repeat center center transparent;border:1px solid #cccccc;margin-right:1px;height: 22px;width: 22px;}</style><style id=\"anchor\">.anchorclass{background: url(\'http://localhost:8082/ETW/ueditor/themes/default/images/anchor.gif\') no-repeat scroll left center transparent;cursor: auto;display: inline-block;height: 16px;width: 15px;}</style><style type=\"text/css\">body{background-color:#ffffff; background-image:; background-repeat:repeat; background-position:0% 0%; height:2986px; }</style> </head><body ><p style=\"text-align: center;\"><strong><span style=\"font-size: 24px;\">市场分析</span></strong></p><p style=\"text-align: center; line-height: normal; margin-top: 5px;\"><span style=\"font-size: 10px; color: rgb(127, 127, 127);\">market analysis</span></p><p style=\"line-height: normal; margin-top: 5px;\"><span style=\"font-size: 10px; color: rgb(127, 127, 127);\"><br/></span></p><p style=\"text-align: center;\"><span style=\"font-size: 12px; color: rgb(63, 63, 63);\">即客的市场：即客市场的大小决定了即客的未来</span></p><p style=\"text-align: center;\"><span style=\"font-size: 12px; color: rgb(63, 63, 63);\">客户的市场：客户的市场决定了即客的出路</span></p><p style=\"text-align: center;\"><span style=\"font-size: 12px; color: rgb(63, 63, 63);\">用户行为：用户的行为奠定了即客存在的基础</span></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\">若您需要企业的具体某一产品拥有需求趋向，<a href=\"#\" target=\"_blank\">请与我们联系</a></p><p style=\"box-sizing: border-box; padding: 0px; margin-bottom: 18px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, tahoma, verdana, 宋体, SimSun, 华文细黑, STXihei, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"148\" valign=\"top\" style=\"border: none;\"><br/></td><td width=\"148\" valign=\"top\" style=\"border: none;\"><br/></td><td width=\"148\" valign=\"top\" style=\"word-break: break-all; border: none;\" align=\"center\"><div style=\"display: inline-block;padding: 8px 16px;border: 1px solid #ccc;border-radius: 5px\"><a href=\"/ETW/manager/main#\" target=\"_blank\" style=\"white-space: normal; text-decoration-line: none;\"><span style=\"color: rgb(63, 63, 63);\">S</span><span style=\"color: rgb(63, 63, 63);\">AAS市场</span></a></div></td><td width=\"148\" valign=\"top\" style=\"word-break: break-all; border: none;\" align=\"center\"><div style=\"display: inline-block;padding: 8px 16px;border: 1px solid #ccc;border-radius: 5px\"><span style=\"color: rgb(63, 63, 63);\">零售</span><a href=\"/ETW/manager/main#\" target=\"_blank\" style=\"white-space: normal; color: rgb(63, 63, 63);\">市场</a></div></td><td width=\"148\" valign=\"top\" style=\"word-break: break-all; border: none;\" align=\"center\"><div style=\"display: inline-block;padding: 8px 16px;border: 1px solid #ccc;border-radius: 5px\">用户行为</div></td><td width=\"148\" valign=\"top\" style=\"border: none; word-break: break-all;\"><br/></td><td width=\"148\" valign=\"top\" style=\"border: none;\"><br/></td></tr></tbody></table><p><br/></p><p style=\"text-align: center;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490405688098322.jpg\" title=\"1520490405688098322.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/><span style=\"text-align: center; color: rgb(89, 89, 89); font-size: 24px;\">SAAS市场</span><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490363839079522.jpg\" title=\"1520490363839079522.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/></p><p><br/></p><blockquote style=\"border-left: 3px solid rgb(229, 230, 225); margin-left: 0px; padding-left: 5px; line-height: 36px; background: rgba(204, 204, 204, 0.19);\"><p style=\"text-indent: 2em;\">信息覆盖下的空间就是市场</p><p style=\"text-indent: 2em;\"><span style=\"background-color: rgba(204, 204, 204, 0.19);\">2016全球SaaS行业的销售规模约为930亿美元。2017年中国SaaS行业</span><span style=\"background-color: rgba(204, 204, 204, 0.19);\">市场规模为168.7亿元，增长率为32.3%，未来几年仍将保持30%以上的增长率。</span></p></blockquote><blockquote><p><br/></p><p style=\"text-align: center;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520524176560030588.png\" title=\"1520524176560030588.png\" alt=\"image.png\"/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490405688098322.jpg\" title=\"1520490405688098322.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/><span style=\"color: rgb(89, 89, 89); font-size: 24px;\">零售市场</span><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490363839079522.jpg\" title=\"1520490363839079522.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/></p><p style=\"white-space: normal;\"><br/></p></blockquote><blockquote style=\"border-left: 3px solid rgb(229, 230, 225); margin-left: 0px; padding-left: 5px; line-height: 36px; background: rgba(204, 204, 204, 0.19);\"><p style=\"white-space: normal; text-indent: 2em;\">巨头追逐的行业就是机会</p></blockquote><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"177\" valign=\"top\" style=\"word-break: break-all; border: none;\"><br/></td><td width=\"177\" valign=\"top\" style=\"border: none;\"><br/></td><td width=\"177\" valign=\"middle\" style=\"word-break: break-all; border: none;\" align=\"center\">零售市场复苏</td><td width=\"177\" valign=\"middle\" style=\"word-break: break-all; border: none;\" align=\"center\">新零售市场风生水起</td><td width=\"177\" valign=\"top\" style=\"word-break: break-all; border: none;\"><br/></td><td width=\"177\" valign=\"top\" style=\"border: none;\"><br/></td></tr></tbody></table><blockquote><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/></p><p style=\"text-align: center;\"><span style=\"font-size: 18px;\"><strong>零售市场复苏</strong></span></p><p><br/></p></blockquote><blockquote style=\"border-left: 3px solid rgb(229, 230, 225); margin-left: 0px; padding-left: 5px; line-height: 36px; background: rgba(204, 204, 204, 0.19);\"><p style=\"text-indent: 2em;\">2017 年 1-10 月，中国社会消费品零售总额累计 29.74 万亿元，累计同比增长 10.3%，预估年零售总额达40万亿元。</p></blockquote><blockquote><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520524587701090096.png\" title=\"1520524587701090096.png\" alt=\"image.png\" width=\"323\" height=\"234\"/></td><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520524591459067589.png\" title=\"1520524591459067589.png\" alt=\"image.png\" width=\"376\" height=\"231\"/></td><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520524594680058200.png\" title=\"1520524594680058200.png\" alt=\"image.png\" width=\"349\" height=\"229\"/></td></tr></tbody></table><p><br/></p><p><br/></p><p style=\"text-align: center;\"><span style=\"font-size: 18px;\"><strong>新零售风生水起</strong></span></p><p><br/></p><p><br/></p><table><tbody><tr class=\"firstRow\"><td width=\"234\" valign=\"top\" style=\"word-break: break-all; border: none;\"><br/></td><td width=\"555\" valign=\"top\" style=\"word-break: break-all; border: none;\"><p style=\"line-height: 1.5em;\"><span style=\"font-size: 14px; color: rgb(89, 89, 89);\">阿里、京东、苏宁、沃尔玛、优衣库等传统零售商以及小米之家等创业公司纷纷强强联合，或充分发挥已具备的线下基因优势抢滩新零售市场，各电商巨头布局蓝海战略</span>。</p></td><td width=\"255\" valign=\"top\" style=\"border: none;\"><br/></td></tr></tbody></table><p><br/></p><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"348\" valign=\"middle\" style=\"word-break: break-all; border: none;\" align=\"center\"><span style=\"font-size: 14px;\"><strong>京东便利店</strong></span></td><td width=\"348\" valign=\"middle\" style=\"word-break: break-all; border: none;\" align=\"center\"><br/></td><td width=\"348\" valign=\"middle\" style=\"word-break: break-all; border: none;\" align=\"center\"><span style=\"font-size: 14px;\"><strong>阿里盒马鲜生</strong></span></td></tr><tr><td valign=\"middle\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all; border: none;\" align=\"center\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520524915548077480.png\" title=\"1520524915548077480.png\" alt=\"image.png\"/></td><td valign=\"middle\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all; border: none;\" align=\"center\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520524919224035629.png\" title=\"1520524919224035629.png\" alt=\"image.png\"/></td><td valign=\"middle\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all; border: none;\" align=\"center\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520524923201031035.png\" title=\"1520524923201031035.png\" alt=\"image.png\"/></td></tr></tbody></table><p><br/></p><p><br/></p><p style=\"text-align: center;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490405688098322.jpg\" title=\"1520490405688098322.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/><span style=\"text-align: center; color: rgb(89, 89, 89); font-size: 24px;\">用户行为</span><img src=\"/ETW/ueditor/jsp/upload/image/20180308/1520490363839079522.jpg\" title=\"1520490363839079522.jpg\" alt=\"line的副本_gaitubao_com_300x1.jpg\"/></p><p><br/></p><p><br/></p><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"191\" valign=\"top\" style=\"border: none;\"><br/></td><td width=\"689\" valign=\"top\" style=\"word-break: break-all; border: none;\"><strong>有人的地方就有消费行为。</strong><br/><br/><p>（1）<span style=\"color: rgb(89, 89, 89);\">扫码付收成为趋势</span></p><p><span style=\"color: rgb(89, 89, 89);\">2016年移动支付用户规模达到4.7亿人，与2015年的3.6亿人，增长30.6%。2017年用户规模进一步增长，达到6亿人，增长率为27.7%。</span></p><p>（2）<span style=\"color: rgb(89, 89, 89);\">分享经济活跃社交</span></p><p><span style=\"color: rgb(89, 89, 89);\">① 2016年我国分享经济市场交易额约为34520亿元，比上年增长103%。</span></p><p><span style=\"color: rgb(89, 89, 89);\">&nbsp; &nbsp; &nbsp; &nbsp;2016年我国参与分享经济活动的人数超过6亿人，比上年增加1亿人左右。</span></p><p><span style=\"color: rgb(89, 89, 89);\">② 政策红利助力分享经济发展。</span></p></td><td width=\"164\" valign=\"top\" style=\"border: none;\"><br/></td></tr></tbody></table><p><br/></p><table align=\"center\"><tbody><tr class=\"firstRow\"><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520525233062022392.png\" title=\"1520525233062022392.png\" alt=\"image.png\" width=\"321\" height=\"224\"/></td><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520525236652016792.png\" title=\"1520525236652016792.png\" alt=\"image.png\" width=\"322\" height=\"206\"/></td><td width=\"348\" valign=\"top\" style=\"word-break: break-all; border: none;\"><img src=\"/ETW/ueditor/jsp/upload/image/20180309/1520525239936061519.png\" title=\"1520525239936061519.png\" alt=\"image.png\" width=\"380\" height=\"222\"/></td></tr></tbody></table><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p></blockquote><p><br/></p><p><br/></p><p><br/></p><p><br/></p></body></html>', '市场分析', '6', 'marketAnalysis.jsp');
